import React, { useState } from "react";
import { APIProvider, Map, Marker } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png';

const AddProperty = () => {
    const [markers, setMarkers] = useState([]);
    const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

    const ClearOutput = () => {
        // Clear form inputs and reset markers
        // Implement clearing logic here
        setMarkers([]);
    };

    const handleMapClick = (event) => {
        // Handle click on map to add marker
        // Implement marker adding logic here
    };

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <div className="container">
                <nav className="navbar">
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <div className="nav-links">
                        <Link to="/Home" title="Home"><b>Home</b></Link>
                        <Link to="/WardenDashbord" title="Dashboard"><b>Dashboard</b></Link>
                        <Link to="/WardenProfile" title="Profile"><b>Profile</b></Link>
                        <Link to="/WardenProperty" title="Reservations"><b>Property</b></Link>
                        <Link to="/Home" title="Profile"><b>Sign Out</b></Link>
                    </div>
                </nav>

                <div className="content">
                    <div className="form-section">
                        <h1 className="form-title">Add New Property</h1>
                        <form className="property-form">
                            {/* Form inputs go here */}
                        </form>
                    </div>
                    <div className="map-section">
                        <h2 className="map-title">Enter Location</h2>
                        <div className="map-container">
                            <Map defaultCenter={position} defaultZoom={15} onClick={handleMapClick}>
                                {markers.map((marker, index) => (
                                    <Marker key={index} position={marker} />
                                ))}
                            </Map>
                        </div>
                    </div>
                </div>
